import React, { useEffect, useState } from "react";
import "./home.css";
import { useNavigate } from "react-router-dom";

const Home = () => {
  const navigate = useNavigate();
  const [data, setData] = useState([]);
  const [filteredData, setFilteredData] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");
  const [showMenu, setShowMenu] = useState(false); // State to toggle menu

  useEffect(() => {
    fetch("/date.json")
      .then((response) => response.json())
      .then((json) => {
        setData(json);
        setFilteredData(json);
      });
  }, []);

  const handleSearchChange = (event) => {
    const value = event.target.value.toLowerCase();
    setSearchTerm(value);

    const filtered = data.filter((item) => {
      const name = item.name?.toLowerCase() || "";
      const category = item.category?.toLowerCase() || "";
      return name.includes(value) || category.includes(value);
    });
    setFilteredData(filtered);
  };

  const handleFoodDetails = () => {
    navigate("/FoodDetails");
  };

  const handleCategory = () => {
    navigate("/Category");
  };

  const handleProfile = () => {
    navigate("/Profile");
  };

  const handleFavorites = () => {
    navigate("/Fav");
  };

  const handleLogout = () => {
    // Logic for logout (e.g., clear tokens, redirect to login page)
    alert("Logged out successfully!");
    navigate("/Login");
  };

  const toggleMenu = () => {
    setShowMenu(!showMenu);
  };

  return (
    <div className="he">
      <div className="head">
        <div className="menu-bar" onClick={toggleMenu}>
          <img src="./asset/menu-icon.png" alt="menu" className="menu-icon" />
        </div>
        <span className="war">Deliver To</span>
        <img src="./asset/Group (2).png" alt="pi" className="mbd" onClick={handleProfile} />
      </div>

      {showMenu && (
        <div className="menu-dropdown">
          <ul>
            <li onClick={handleProfile}>Profile</li>
            <li onClick={handleFavorites}>Favorites</li>
            <li onClick={handleLogout}>Logout</li>
          </ul>
        </div>
      )}

      <div>
        <h4>What Would You Like</h4>
        <br />
      </div>

      <div>
        <input
          className="asd"
          type="text"
          placeholder="Find food or restaurant"
          value={searchTerm}
          onChange={handleSearchChange}
        />
      </div>

      <div className="mapped">
        {filteredData.length > 0 ? (
          filteredData.map((val, index) => (
            <div key={index} className="ima" onClick={handleCategory}>
              <img src={val.image} alt={val.name} width={"60px"} />
              <h5>{val.name}</h5>
            </div>
          ))
        ) : (
          <p>No results found.</p>
        )}
      </div>

      <div className="fla">
        <h3 className="plk">Featured Restaurant</h3>
        <p className="ak" onClick={handleFavorites}>
          View All
        </p>
      </div>

      <div className="khan">
        <img
          src="./asset/last.png"
          alt="piu"
          width={"200px"}
          onClick={handleFoodDetails}
        />
        <img src="./asset/two.png" alt="bur" width={"200px"} />
      </div>

      <div className="icons">
        <img src="./asset/three.png" alt="pol" width={"20px"} />
        <img src="./asset/four.png" alt="pol" width={"20px"} />
        <img src="./asset/five.png" alt="pol" width={"20px"} />
        <img src="./asset/six.png" alt="pol" width={"20px"} />
        <img src="./asset/three.png" alt="pol" width={"20px"} />
      </div>
    </div>
  );
};

export default Home;
